export const CHECKOUT_MAX_LIVE_DAYS_IN_STORAGE = 1;

export const checkoutStepsNames = [
  'Review your order',
  'Payment details',
  'Order placed',
];

export const checkoutStepsValues = {
  REVIEW_ORDER: 0,
  PAYMENT_DETAILS: 1,
  ORDER_PLACED: 2,
};
